INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (47, 13, 12, '');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (47, 13, 13, '');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (47, 13, 14, '');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 1, 'PAVEL, apostol – [poseben odposlanec, imenovan in pooblaščen in poslan] ne od [kateregakoli] človeškega [organa], ne po |kateremkoli človeku| ali zaradi kateregakoli človeka, temveč po |Jezusu Kristusu| in zaradi Jezusa Kristusa (Mesija) in Boga Očeta, katerega je On obudil od mrtvih – ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 2, 'in vsi bratje, ki so z menoj, cerkvam v Galatiji: ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 3, 'milost in duhovni blagoslov naj vam bo in [dušni] mir od Boga Očeta in našega Gospoda Jezusa Kristusa (Mesija), ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 4, 'ki je daroval (izročil) samega Sebe, [ da bi odplačal] za naše grehe [in da bi nas rešil in nas posvetil], tako da bi nas rešil in iztrgal iz sedanje zlobne dobe in svetovne ureditve, v soglasju z voljo in namenom in načrtom našega Boga in Očeta – ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 5, 'Njemu [bodi pripisana vsa] slava skozi vse veke vekov in večnosti večnosti! Amen (tako naj bo). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 6, 'Presenečen in začuden sem, da se tako hitro obračate kot odpadniki in zapuščate Njega, ki vas je povabil in poklical po milosti, (nezasluženi naklonjenosti) Kristusa (Mesija) [in da svojo zvestobo prenašate] k drugačnemu [celo nasprotnemu] evangeliju. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 7, 'Ne da je [ali bi lahko bil] katerikoli drug [pristen evangelij] temveč so [očitno] nekateri, ki vas nadlegujejo in vznemirjajo in begajo [ z drugačno vrsto učenja, katerega ponujajo kot evangelij] in hočejo popačiti in izkriviti evangelij Kristusa (Mesija) [v nekaj, kar evangelij nikakor ni]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 8, 'Toda celo, če bi vam mi ali angel iz nebes oznanjal evangelij, nasproten in drugačen od tega, katerega smo vam mi oznanili, naj bo preklet, (izobčen, predan uničenju, obsojen na večno kazen)! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 9, 'Kakor smo že prej povedali, tako sedaj ponovno pravim: \"Če vam kdorkoli oznanja evangelij, ki je drugačen ali nasproten od tega, ki ste ga prejeli [od nas], naj bo preklet, (izobčen, predan uničenju, obsojen na večno kazen)!\" ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 10, 'Mar skušam sedaj doseči naklonjenost od ljudi ali od Boga? Si mar prizadevam, da bi ugajal ljudem? Če bi še vedno iskal priljubljenost pri ljudeh, ne bi bil zavezan služabnik Kristusa (Mesija). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 11, 'Kajti želim, da veste, bratje, da evangelij, ki je bil razglašen in oznanjen po meni, ni človeški evangelij, [človeško odkritje, glede na |človeški standard| ali oblikovan po kakršnem koli človeškem standardu]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 12, 'Nikakor ga namreč nisem prejel od človeka, niti nisem bil poučen, temveč [je prišel k meni] po [neposrednem] razodetju, [danem] po Jezusu Kristusu, (Mesiji). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 13, 'Slišali ste o moji prejšnji službi in prejšnjem načinu življenja v judovski veri (judovstvu), kako sem besno in temeljito preganjal in zlorabljal Božjo cerkev in si [s strastno gorečnostjo prizadeval dati vse od sebe], da bi iz nje naredil opustošenje in jo uničil. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 14, 'In [slišali ste kako] sem med rojaki prekašal mnoge sovrstnike v [svojem napredovanju v študiju in izpolnjevanju zakonov] judovstva, tako izjemno navdušen in goreč sem bil za izročila svojih prednikov. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 15, 'Ko pa se je Njemu, ki me je izbral in oddvojil [celo] preden sem bil rojen in me je poklical po Svoji milosti, (Njegovi nezasluženi naklonjenosti in blagoslovu), zdelo primerno in mu je ugajalo,  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 16, 'da v meni razodene, (odkrije, sname zagrinjalo) Svojega Sina, da bi smel Sina oznanjati med pogani, (ne-judovskemu svetu), kot veselo oznanilo (evangelij), se nisem takoj zatekel k mesu in krvi, [nisem se posvetoval ali si dal svetovati kateremu koli slabotnemu človeškemu bitju ali komuniciral s komerkoli]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 17, '[Celo] niti nisem šel gor v Jeruzalem k tistim, ki so bili apostoli, (posebni Kristusovi odposlanci), preden sem bil jaz, ampak sem šel proč in se umaknil v Arabijo in kasneje ponovno prišel nazaj v Damask. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 18, 'Potem sem tri leta kasneje šel gor v Jeruzalem, da bi se [osebno] seznanil s Kefom (Petrom) in ostal z njim petnajst dni. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 19, 'Toda nobenega drugega apostola, (posebnega Kristusovega odposlanca), nisem videl razen Jakoba, brata našega Gospoda. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 20, 'In sedaj [skrbno upoštevajte kar vam pravim, kajti to je resnica], to pišem kot bi stal pred Božjo palico; ne lažem. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 21, 'Nato sem šel v okraje, (pokrajine, območja) Sirije in Kilikije. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 22, 'In zaenkrat sem bil še vedno osebno nepoznan Kristusovim cerkvam v Judeji, (pokrajini, ki obdaja Jeruzalem). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 23, 'Le slišali so govoriti: \"Tisti, ki nas je nekoč preganjal, sedaj razglaša prav tisto vero, katero je nekoč sramotil in ki jo je nameraval uničiti in jo skušal z vso svojo močjo zatreti.\" ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 1, 24, 'In slavili so Boga, [kot avtorja in vir tega, kar se je zgodilo] v meni. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 1, 'POTEM sem po [obdobju] štirinajstih let ponovno šel gor v Jeruzalem. [Tokrat sem šel] z Barnabom, s [seboj] sem vzel tudi Tita. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 2, 'Šel sem, ker mi je bilo posebno in božansko razodeto naj grem in jim predstavim evangelij, [jim razglasim tisto], kar pridigam med pogani. Vendar [sem stvar predstavil] osebno pred tistimi z ugledom, [kajti hotel sem se prepričati in tako najprej omejiti moj pogovor na to osebno srečanje], da nisem tekel ali da nisem tekel zaman, [varovajoč se pred tem, da bi bil osramočen glede tega, kar sem nameraval storiti ali kar sem že storil]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 3, 'Toda [vse je šlo v redu!], celo Tit, ki je bil z menoj, ni bil prisiljen, [kakor so nekateri pričakovali], dati se obrezati, čeprav je bil Grk. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 4, '[Moja previdnost je bila] zaradi lažnih bratov, ki so se na skrivnem vtihotapili [v bratstvo kristjanov]; vrinili so se, da bi vohunili za našo svobodo in prostost, ki jo imamo v Kristusu Jezusu, da bi nas lahko ponovno pripeljali v suženjstvo, [pod Mojzesovo postavo]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 5, 'Njim se nismo dovolili podrediti niti za trenutek, da bi resnica evangelija lahko še naprej obstala [ohranjena] za vas [v svoji čistosti]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 6, 'Poleg tega [ni bilo nobenih novih zahtev] od tistih, ki so imeli ugled, da nekaj so – čeprav kakšen je bil njihov osebni položaj in ali so bili resnično pomembni ali ne, mene ne zanima; na Boga ne naredijo vtisa položaji, ki jih ljudje zasedajo in On ni pristranski in ne priznava zunanjih odlik – tisti, [pravim], ki so veljali za ugledne, mi niso naložili nobenih dodatnih zahtev, [niso imeli ničesar dodati mojemu evangeliju in od njih nisem prejel nobenih novih predlogov].  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 7, 'Nasprotno, ko so [resnično] videli, da mi je bilo zaupano, [da ponesem] evangelij neobrezanim [poganom enako odločno], kot je bilo Petru zaupano, [da razglasi] evangelij obrezanim [Judom, so bili soglasni]; ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 8, 'kajti Tisti, ki je navdihoval in opremljal Petra in po njem učinkovito deloval zaradi poslanstva obrezanim, je navdihoval in opremljal mene in po meni tudi deloval zaradi [poslanstva] poganom. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 9, 'In ko so spoznali, (sprejeli, prepoznali, razumeli in priznali) milost, (Božjo nezasluženo naklonjenost in duhovni blagoslov), ki mi je bila dana, so Jakob in Kefa (Peter) in Janez, ki so sloveli kot stebri jeruzalemske cerkve, meni in Barnabu podali desnico prijateljstva, z razumevanjem, da naj bi midva šla med pogane, oni pa med obrezane (Jude). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 10, '[Dali] so nama samo [eno določilo], da bi se spominjala revežev, prav to, kar sem bil tudi sam željan storiti. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 11, 'Ko pa je Kefa (Peter) prišel v Antiohijo, sem mu v njegov obraz ugovarjal in nasprotoval [v zvezi z njegovim tamkajšnjim obnašanjem], kajti bil je vreden obsojanja in stal obsojen. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 12, 'Kajti preden so namreč od Jakoba prišle nekatere osebe, je svoje obroke jedel s pogani [spreobrnjenci]; toda ko pa so prispeli ljudje [iz Jeruzalema], se je umaknil in se držal proč od poganov in [jedel] ločeno iz strahu pred temi iz [skupine] obrezancev. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 13, 'Tudi drugi Judje so skupaj z njim zatajili svoja resnična prepričanja in se obnašali neiskreno, z rezultatom, da je bil celo Barnaba zaveden z njihovo hinavščino, (njihovim zgledom neiskrenosti in pretvarjanja). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 14, 'Toda takoj, ko sem videl, da niso bili iskreni in ne živijo v skladu z resnico evangelija, sem pred vsemi prisotnimi Kefu (Petru) rekel: \"Če ti, ki si rojen Jud, lahko živiš [tako kakor si živel] kot pogan in ne kot Jud; kako si sedaj drzneš siliti in praktično prisiliti pogane, da se [podredijo običajem Judovstva in] živijo podobno kakor Judje?\" ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 15, '[Nadaljeval sem]: \"Čeprav sva midva, (ti in jaz), po rojstvu Juda in ne poganska (brezbožna) grešnika, ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 16, 'veva, da človek ni opravičen ali štet za pravičnega in v pravem odnosu z Bogom, po delih postave, ampak [le] po veri in [popolnem] zanašanju na |Jezusa Kristusa| in oprijemanju k |Jezusu Kristusu| in zaupanju v Jezusa Kristusa (Mesija, Maziljenca). [Zato] smo celo mi [sami] verovali v Jezusa Kristusa, da bi bili opravičeni po veri v Kristusa in ne po delih postave, [kajti ne moremo biti opravičeni po nikakršnem izpolnjevanju obredov postave, danih po Mojzesu]; ker s tem, da se držimo veljavnih obredov in po delih nobeno človeško bitje nikoli ne more biti opravičeno, (razglašeno za pravično in se postaviti v pravi odnos z Bogom).  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 17, 'Toda če se v naši želji in prizadevanju, da bi bili opravičeni v Kristusu, [da bi bili razglašeni za pravične in postavljeni v pravi odnos z Bogom v celoti in samo skozi Kristusa], tudi mi sami izkažemo za grešnike in obsojene greha, ali to dela Kristusa posrednika, (soudeleženca in sodelavca) našemu grehu? Opustite to misel! [Seveda ne!] ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 18, 'Kajti če jaz [ali katerikoli drugi, ki imajo misel, da izpolnjevanje Mojzesove postave ni bistveno, da bi bili opravičeni pri Bogu, naj torej z besedo ali praktičnim učenjem ali sporočilom, ki je bistveno, da] ponovno zgradim, kar sem porušil, samega sebe potrjujem za prestopnika. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 19, 'Kajti po postavi sem [pod delovanjem prekletstva postave] [v Kristusovi smrti zame] sam odmrl postavi in vsem zahtevam postave nad menoj, tako da smem [odslej] živeti Bogu in za Boga. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 20, 'Križan sem bil s Kristusom, [v Njem sem z njim delil Njegovo križanje]; nisem več jaz tisti, ki živi, temveč Kristus (Mesija) živi v meni; in življenje, ki ga sedaj živim v telesu, živim po veri v (zvestobi do |Božjega Sina| in zanašanju na |Božjega Sina| in popolnem zaupanju v) Božjega Sina, ki me je ljubil in samega Sebe daroval zame. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 2, 21, '[Zato z Božjim milostnim darom ne ravnam kakor z nečem, kar je manj pomembno in tako zametujem njegov pravi namen]; ne postavljam ob stran in razveljavljam in onemogočam in izničujem milosti, (nezaslužene naklonjenosti) od Boga. Kajti če opravičenje, (pravičnost, oproščenje od krivde) pride zaradi [izpolnjevanja obredov] postave, potem je Kristus (Mesija) umrl brez razloga in brez namena in zaman. [Njegova smrt je bila potemtakem v celoti nepotrebna.] ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 1, 'O VI ubogi in neumni in nepremišljeni in neodzivni in brezčutni Galačani! Kdo vas je očaral ali začaral ali uročil, katerim je bil – prav pred vašimi očmi – javno in nazorno predstavljen Jezus Kristus (Mesija) in naslikan kot križan? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 2, 'Naj vas vprašam samo eno vprašanje: ali ste [Svetega] Duha prejeli kot rezultat uboganja postave in izpolnjevanja njenih del, ali zaradi tega, ker ste slišali [sporočilo evangelija] in [vanj] verjeli? [Ali je bilo iz spoštovanja postavnih obredov ali iz sporočila vere?] ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 3, 'Ali ste tako nespametni in tako brezčutni in tako neumni? [Svoje novo duhovno življenje] ste začeli s [Svetim] Duhom, ali sedaj dosegate popolnost [z odvisnostjo] mesu? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 4, 'Ali ste tako veliko stvari trpeli in izkusili toliko vsega zastonj, (zaman) – če bi res bilo zaman in brez uspeha? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 5, 'Potem ali Ta, ki vas oskrbuje s Svojim čudovitim [Svetim] Duhom ter močno in čudežno deluje med vami, dela to na [temelju vašega izpolnjevanja] tega kar zahteva postava, ali zaradi vašega verovanja v |sporočilo| in zvestobo in zaupanje v |sporočilo| in zanašanje na sporočilo katerega ste slišali? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 6, 'Tako je Abraham veroval v |Boga| in bil zvest |Bogu| in zaupal v |Boga| in se zanašal na Boga in mu je bilo to všteto in položeno na njegov račun in priznano kot pravičnost, (kot soglasnost Božji volji in namenu, misli in delovanju).  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 7, 'Spoznajte in razumite, da so [dejansko] ljudje, [ki živijo]) po veri, tisti, ki so [pravi] Abrahamovi sinovi. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 8, 'In ker je Pismo predvidelo, da bo Bog pogane opravičil zaradi vere, (razglasil za pravične, postavil v pravi odnos s Seboj), je napovedal evangelij, [dolgo vnaprej je prerokoval veselo oznanilo o Odrešeniku] Abrahamu v obljubi, rekoč: \"V tebi bodo blagoslovljeni vsi narodi [zemlje].\"  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 9, 'Torej tisti, ki so ljudje vere, so blagoslovljeni in narejeni vesele in privilegirani pri Bogu, [kot udeleženci v bratstvu], skupaj z verujočim in zaupajočim Abrahamom. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 10, 'In vsi, ki se zanašajo na postavo, [ki iščejo opravičenje z ubogljivostjo postavi obredov] so pod prekletstvom in obsojeni na razočaranje in uničenje, saj je pisano v Pismih: \"Preklet, (zaklet, predan uničenju, obsojen na večno kazen), bodi vsak, ki ne vztraja, (živi in ostaja) pri vseh navodilih in ukazih, zapisanih v knjigi postave, da bi jih izpolnjeval.\"  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 11, 'Torej je razvidno, da se nihče ne more opravičiti, (razglasiti za pravičnega in privesti v pravi odnos z Bogom) preko postave, saj Pismo pravi: \"Človek v pravem odnosu z Bogom, [pravičen, opravičen], bo živel po |veri| in iz vere in kdor je preko |vere| in po veri razglašen za pravičnega in v pravem odnosu z Bogom, bo živel.  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 12, 'Toda postava ne sloni na veri, [ne zahteva vere, nima nič z vero], saj sama pravi: \"Kdor to izpolnjuje, [stvari predpisane s postavo], bo živel od tega, [ne pa po veri].\"  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 13, 'Kristus pa je kupil našo svobodo, [nas je odkupil] od prekletstva (obsodbe) postave [in njenega prekletstva] tako, da je [On sam] za nas postal prekletstvo, kajti pisano je namreč [v Pismih]: \"Preklet je vsak kdor visi na drevesu, (je križan);  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 14, 'do konca, da bi zaradi [njihovega sprejetja] Kristusa Jezusa blagoslov, [obljubljen] Abrahamu, lahko prišel nad pogane tako, da bi mi [vsi] preko vere lahko prejeli [uresničenje] obljube [Svetega] Duha. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 15, 'Bratje, če govorim v skladu s človeškimi odnosi: [če] celo človek naredi zadnjo željo in oporoko, (zgolj človeško zavezo), je nihče ne bo dajal na stran ali jo razveljeval ali ji kaj dodajal po tem, ko je bila nekoč sklenjena in podpisana, (priznana, potrjena). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 16, 'Torej, obljube, (sporazumi, dogovori) so bili izrečeni in narejeni Abrahamu in njegovemu Potomcu, (njegovemu Nasledniku, njegovemu Dediču). On [Bog] ne pravi: \"In potomcem (naslednikom, dedičem)\", kakor bi šlo za mnogo oseb, temveč: \"In tvojemu Potomcu (tvojemu Nasledniku, tvojemu Dediču),\" očitno nanašajoč se na enega posameznika, ki je [nihče drug kakor] Kristus (Mesija).  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 17, 'Moja utemeljitev je tale: postava, ki se je pričela štiristo trideset let po zavezi, [se nanaša na prihajajočega Mesija], noče in ne more razveljaviti prej vzpostavljene, od Boga (priznane) zaveze, tako, da bi razveljavila obljubo in jo naredila neučinkovito.  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 18, 'Kajti če je dediščina [obljube odvisna od izpolnjevanja] postave, [kakor bi ti lažni učitelji radi, da verjamete], potem ni več [odvisna] od obljube; toda Bog jo je dal Abrahamu, [kot izključno brezplačno darilo], zaradi Njegove obljube. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 19, 'Kakšen je bil potem namen postave? Dodana je bila [kasneje, po obljubi, da bi odkrila in ljudem izpostavila njihovo krivdo] zaradi prestopkov in [da bi se človek bolj zavedal grešnosti] greha; namenjena je bila, da bo v veljavi dokler ne bi prišel Potomec (Naslednik, Dedič), h |kateremu| in glede katerega je bila dana obljuba. In [postava] je bila dogovorjena in odrejena in razglašena po posredovanju angelov [in je bila dana] z roko (v osebi) po posredniku [med Bogom in človekom, Mojzesu]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 20, 'Torej posrednik (posredovalec) mora imeti opravka s |stranko| in se nanašati na več kot eno stranko, [ne more biti posrednika s samo eno osebo]. Vendar je Bog [samo] ena Oseba [in On je bil edini soudeleženec med dajanjem obljube Abrahamu. Toda zakon je bila pogodba med dvema, Bogom in Izraelom; in veljavnost le-tega je bila odvisna od obeh.] ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 21, 'Ali je potem postava v nasprotju in ugovarja Božjim obljubam? Seveda ne! Kajti če bi bila dana postava, ki bi lahko podelila [duhovno] življenje, potem bi pravičnost in pravi odnos z Bogom zagotovo prišla po postavi. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 22, 'Toda Pismo [predstavlja vse človeštvo kot grešnike], utišane in zaprte zaradi greha, tako da je [dediščina, blagoslov], ki je bila obljubljena po veri v Jezusa Kristusa (Mesija), lahko dana (sproščena, predana in poverjena) [vsem] tistim, ki verujejo, [ki ostanejo zvesti in zaupajo in se zanašajo Nanj]). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 23, 'Torej, preden pa je vera prišla, smo bili nepretrgoma zastraženi pod postavo, držani v ujetništvu v pripravi na vero, ki je bila določena, da se razodene, (odkrije, izpove), ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 24, 'tako je postava služila [nam Judom] kot naša vzgojiteljica, [naš varuh, naš vodič h Kristusu, da nas je vodila) do Kristusovega [prihoda], da bi bili lahko opravičeni, (razglašeni za pravične, postavljeni v pravi odnos z Bogom), po |veri| in preko vere. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 25, 'Toda sedaj, ko je vera prišla, nismo več pod vzgojiteljico, (varuhom našega otroštva). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 26, 'Kajti v Kristusu Jezusu ste po veri vsi Božji sinovi. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 27, 'Kajti kolikor [izmed vas] je bilo krščenih v Kristusa, [v duhovno zvezo in skupnost s Kristusom, Maziljencem, Mesijo] ste si nadeli |Kristusa|, (sebe oblekli s) Kristusom. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 28, 'Tukaj [sedaj ni več nobene različnosti], niti Juda, niti Grka, ne sužnja, ne svobodnega, ne moškega in ne ženske; kajti vsi ste eno v Kristusu Jezusu. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 3, 29, 'In če pripadate Kristusu, [ste v Njem, ki je Abrahamov Potomec], potem ste Abrahamovi potomci in glede na obljubo [duhovni] dediči. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 1, 'TOREJ KAR menim je, da vse dokler je dedič (naslednik) še otrok in nedoleten, se ne razlikuje od sužnja, pa čeprav je gospodar vsega posestva; ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 2, 'temveč je pod varuhi in upravitelji ali oskrbniki vse do dne, ki ga je določil njegov oče. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 3, 'Tako tudi mi, [judovski kristjani], ko smo bili še mladoletni, smo bili držani kot sužnji pod [pravili hebrejskih običajev in bili podrejeni] osnovnim učenjem ustroja zunanjih opazovanj in pravil. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 4, 'Toda ko je primeren čas v polnosti prispel, je Bog poslal Svojega Sina, rojenega iz žene, rojenega v podrejenosti [predpisom] postave, ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 5, 'da kupi svobodo, (da odkupnino, da odkupi, da odplača za) tiste, ki so bili pod postavo, da bi mi tako lahko bili posvojeni in bi nad nami imeli podeljeno sinovstvo [in bili prepoznani kot Božji sinovi]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 6, 'In ker ste vi [resnično] [Njegovi] sinovi, je Bog v naša srca poslal [ Svetega] Duha Svojega Sina, ki kliče: \"Abba (Oče)! Oče!\" ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 7, 'Zatorej nisi več suženj, (podložen služabnik), temveč sin; in če si sin, potem [sledi, da si] dedič z Božjo pomočjo, preko Kristusa. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 8, 'Toda ob tem prejšnjem času, ko še niste bili seznanjeni z |resničnim Bogom| in razumeli in poznali resničnega Boga, ste bili [pogani] podložni bogovom, ki po svoji naravi sploh niso mogli biti bogovi, [bogovi, ki v resnici niso obstajali]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 9, 'Toda sedaj, ko ste bili seznanjeni s |pravim Bogom| in ste razumeli in spoznali [pravega] Boga ali bolje rečeno, Bog vas je razumel in prepoznal, kako se lahko ponovno obrnete nazaj k šibkim in revnim in ničevim prvinam [ vseh religij, preden je prišel Kristus] in katerih sužnji hočete še enkrat postati? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 10, 'Vi slavite [posebne] dneve in mesece in letne čase in leta! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 11, 'Opozorjen sem bil [glede vas], da sem se med vami in nad vami trudil zaman in v prazno. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 12, 'Bratje, prosim vas, postanite kakor jaz, [svoboden vezi judovskih obredov in navad], kajti tudi sam sem postal kakor ste vi, [ pogan]. Niste mi storili krivice [ v dneh, ko sem prvič prišel k vam; ne storite tega sedaj]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 13, 'Nasprotno, vi veste, da je bilo na račun telesne slabosti, da [sem ostal in] vam prvič oznanil evangelij. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 14, 'In [vendar], čeprav je bilo moje telesno stanje vam [takšna] preizkušnja, je niste motrili z zaničevanjem ali prezirom in gnusom in me niste zavrgli; temveč ste me sprejeli kot Božjega angela, [celo] kot Kristusa Jezusa [samega]! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 15, 'Kaj je nastalo iz tistega blagoslovljenega veselja in zadovoljstva in samo-odobravanja, ki je bilo nekoč vaše, [v tem, kar sem vas učil in v vašem spoštovanju do mene]? Imam Vas za priče, da bi si izdrli svoje lastne oči in mi jih dali, [da bi nadomestili moje], če bi bilo to mogoče. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 16, 'Sem potem postal vaš sovražnik s tem, ko sem vam govoril resnico in z vami iskreno ravnal? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 17, 'Ti ljudje, [učitelji Judovstva], si goreče prizadevajo, da vas preslepijo, [vam dvorijo, vas povzdigujejo], toda njihov namen ni častitljiv ali spoštovanja vreden ali koristen za karkoli. Kar hočejo doseči je, da vas ločijo [od nas, ki jim nasprotujemo], da si vas pridobijo na svojo stran in vas skušajo pripraviti, da bi si pridobili njihovo naklonjenost. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 18, '[Seveda] je vedno dobra stvar goreče iskati dober namen, [kakor ste vi, zagotavljam da ste] in delati z razlogom čistosti srca in življenja in ne samo kadar sem med vami prisoten! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 19, 'Moji mali otroci, za katere ponovno trpim porodne bolečine, dokler se v vas popolnoma in trajno ne upodobi, (oblikuje) Kristus, ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 20, 'želel bi, da bi bil sedaj z vami in bi se vam z glasom dobrikal, kajti bojim se in zaskrbljen sem glede vas! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 21, 'Vi mi povejte, ki ste upognjeni s tem, ko ste pod postavo, ali boste poslušali to, kar postava [resnično] pravi? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 22, 'Kajti pisano je, da je Abraham imel dva sinova, enega od dekle in enega od svobodne ženske.  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 23, 'Toda medtem ko je bil otrok sužnje rojen po mesu in je imel običajno rojstvo, je bil sin svobodne rojen kot izpolnitev obljube. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 24, 'Torej vse to je prispodoba; ti [dve ženski] predstavljata dve zavezi. Ena zaveza je izvirala iz gore Sinaj, [kjer je bila dana postava] in nosi [otroka namenjenega] za suženjstvo: to je Hagara. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 25, 'Torej je Hagara (podoba) gore Sinaj v Arabiji in se nanaša na |isto kategorijo| in pripada v isto kategorijo s sedanjim Jeruzalemom, ker je v suženjstvu skupaj s svojimi otroki. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 26, 'Toda Jeruzalem, ki je zgoraj, ( Mesijansko Kristusovo kraljestvo), je svoboden in ta je naša mati. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 27, 'Zakaj pisano je v Pismu: \"Raduj se, o nerodovitna žena, ki nisi rodila otrok, spremeni se v radosten vrisk, ti, ki ne čutiš porodnih bolečin, kajti zapuščena žena ima veliko več otrok kakor tista, ki ima moža.\"  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 28, 'Toda mi, bratje, smo otroci [ ne po telesnem poreklu, kakor je bil Izmael, temveč] kakor Izak, rojeni po odliki obljube. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 29, 'Vendar [ravno] kakor je takrat otrok [običajnega rojstva], rojen po mesu, preziral in preganjal tistega, [ki je bil rojen nenavadno], glede na [obljubo in delovanje] [Svetega] Duha, je tako tudi sedaj.  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 30, 'Toda kaj pravi Pismo? Izženi in pošlji stran sužnjo in njenega sina, kajti sin sužnje nikoli ne bo dedič in dediščine ne bo delil s sinom svobodne ženske.  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 4, 31, 'Torej bratje, mi, [ki smo ponovno rojeni], nismo otroci sužnje [ naravne], temveč iz svobodne, [ nadnaravne]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 1, 'V [tej] svobodi nas je Kristus rešil [in nas popolnoma osvobodil]; stojte torej trdno in se ne dajte motiti in zapeljati v zanko in se ponovno podvreči jarmu suženjstva, [ki ste ga nekoč že sneli]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 2, 'Glejte, jaz sem Pavel, ki vam pravim, da če prejmete obrezo, vam Kristus ne bo nič koristil, (dajal prednost, smisel), [ kajti če ne zaupate Njemu, od Njega nič ne morete pridobiti]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 3, 'Še enkrat ugovarjam in pričujem vsakomur, ki prejme obrezo, da je dolžan in zavezan izpolnjevati vso postavo in njene obrede. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 4, 'Če iščete, da bi bili opravičeni in razglašeni za pravične in bi vam bil skozi postavo dan pravilen odnos z Bogom, niste ničesar pridobili in ste tako (strogo) ločeni od Kristusa. Odpadli ste proč od milosti, (od Božje milostne naklonjenosti in nezasluženega blagoslova). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 5, 'Kajti mi se [ne zanašamo na postavo, temveč] preko [pomoči] [Svetega] Duha po veri pričakujemo in čakamo blagoslov in dobro, za katero nam naša pravičnost in pravi odnos z Bogom, [naša soglasnost Njegovi volji v namenu, mišljenju in delovanju, povzroča], da upamo. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 6, 'Kajti [če smo] v Kristusu Jezusu, niti obreza niti neobreza ne štejeta za karkoli, temveč samo vera sprožena in spodbujena in izražena in delujoča skozi ljubezen. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 7, 'Veličastno ste tekli dirko. Kdo vas je motil, (oviral in ustavljal od) vašega upoštevanja in sledenja resnici? ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 8, 'To [hudobno] prepričanje ni od Tistega, ki vas je poklical, [ki vas je povabil k svobodi v Kristusu]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 9, 'Malo kvasa, (majhna nagnjenost k napaki ali nekaj lažnih učiteljev) skvasi vse testo, [popači celotno pojmovanje vere ali zavede celotno cerkev]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 10, '[Kar se mene tiče] imam zaupanje [do vas] v Gospodu, da ne boste sprejeli nobenih nasprotujočih si pogledov o tej zadevi, ampak boste prišli, da razmišljate z menoj. Toda kdor vas bega, kdorkoli je že, bo moral prenašati kazen. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 11, 'Toda, bratje, če še vedno oznanjam obrezo, [kakor me nekateri obtožujejo, da to počnem kot potrebno za rešitev duše], zakaj še vedno trpim preganjanje? V tem primeru je križ prenehal biti ovira in je izgubil smisel, (je odpravljen). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 12, 'Želim si, da bi tisti, ki vas vznemirjajo in begajo, [ šli do konca in] sami sebe odrezali! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 13, 'Kajti vi, bratje, ste bili [resnično] poklicani v svobodo; le [ne dopustite, da bi bila vaša] svoboda spodbuda vašemu mesu in priložnost ali izgovor [za sebičnost], temveč naj bi skozi ljubezen služili drug drugemu. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 14, 'Kajti vsa postava [v zvezi s človeškimi odnosi] je zajeta v eni zapovedi: \"Svojega bližnjega naj bi ljubil kakor [ljubiš] samega sebe.\"  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 15, 'Če pa se med seboj grizete in obžirate [v strankarskem sporu], bodite previdni, da se vi [in vaša celotna skupnost] med seboj ne uničite. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 16, 'Toda pravim: hodite in živite [vedno] v [Svetem] Duhu, [odzivni in poslušni in vodeni po Duhu]; potem zagotovo ne boste stregli hrepenenjem in željam mesa, (človeške narave brez Boga). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 17, 'Kajti želje mesa nasprotujejo [Svetemu] Duhu, [želje] Duha pa nasprotujejo mesu, (brezbožni človeški naravi); kajti ta |dva| si med seboj nasprotujeta, [si nenehno zoperstavljata in sta v sporu drug z drugim] tako, da niste svobodni, temveč vam je preprečeno delati to, kar si želite. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 18, 'Toda če ste vodeni, (sledite) [Svetemu] Duhu, niste pod postavo. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 19, 'Sedaj so dela (navade) mesa jasne (očitne): to so nečistovanje, nečistost, nespodobnost, ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 20, 'malikovanje, čarovništvo, sovraštvo, prepir, ljubosumnost, jeza (vzkipljivost), sebičnost, nesloga (razhajanja), duh strankarstva (skupine, ločine z nenavadnimi mnenji, krivoverstva), ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 21, 'nevoščljivost, pijančevanje, veseljačenja in kar je še takega. Vnaprej vas svarim, kakor sem to delal prej, da tisti, ki počenjajo takšne stvari, ne bodo podedovali Božjega kraljestva. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 22, 'Toda sad [Svetega] Duha, [delo, ki ga Njegova notranja prisotnost doseže], pa je ljubezen, radost (zadovoljnost), mir, potrpežljivost (miren značaj, potrpljenje), prijaznost, dobrota (blagohotnost), zvestoba, ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 23, 'milina (krotkost, ponižnost), samoobvladovanje (samokontrola, vzdržnost). Zoper te stvari ni postave, [ ki bi lahko prinesla obtožbo]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 24, 'Tisti pa, ki pripadajo Kristusu Jezusu (Mesiju), so križali meso, (brezbožno človeško naravo), skupaj z njenimi strastmi in poželenji in željami. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 25, 'Če živimo po [Svetem] Duhu, tudi hodimo po Duhu. [Če imamo po Svetem Duhu svoje življenje v Bogu, pojdimo naprej hodeč v vrsti, naša dela naj bodo vodena po Duhu]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 5, 26, 'Ne postanimo naduti in domišljavi, tekmovalni in kljubovalni in izzivalni in dražeči drug do drugega, ne zavidajmo in ne bodimo ljubosumni drug na drugega. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 1, 'BRATJE, ČE je kdorkoli zasačen v prestopku ali grehu kakršnekoli vrste, naj bi ga vi, ki ste duhovni, [ki ste občutljivi na |Duha| in vodeni po Duhu], pravilno usmerili in obnovili in ponovno postavili, brez občutka večvrednosti in z vso nežnostjo, imajoč pri tem pozorno oko na sebi, da ne bi bili tudi sami skušani. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 2, 'Nosite, (potrpite, prenašajte), bremena drug drugega in mučne moralne krivde in na ta način izpolnite in se popolnoma držite postave Kristusa (Mesije) in dopolnite, kar še manjka [v vaši ubogljivosti le-tej]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 3, 'Če kdorkoli zase misli, da je kaj, [preveč pomemben, da bi se ponižal in si naložil breme drugega], ko ni nič [večvrednega, razen po njegovi lastni oceni], goljufa in zavaja in vara samega sebe. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 4, 'Toda vsakdo naj pazljivo pregleda in preišče in preizkusi svoje lastno vedenje in svoje lastno delo. Potem ima lahko osebno zadovoljstvo in radost, da je naredil nekaj [ samo po sebi] priporočljivega, ne da bi se [obrnil k] bahavi primerjavi s svojim sosedom. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 5, 'Kajti vsakdo bo namreč moral nositi ( biti enakovreden v razumevanju in mirno sprejeti) svojo lastno [ majhno] breme [morečih krivd]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 6, 'Naj tisti, ki prejema pouk v [Božji] Besedi, vse dobre stvari deli s svojim učiteljem, [prispeva k njegovi podpori]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 7, 'Ne dajte se zapeljati in zavesti in zavajati; Bog Sebi ne bo dopustil, da bi bil v posmeh, (zaničevan, preziran ali zasmehovan z zgolj nadutostjo ali izjavami ali z Njegovimi navodili postavljen ob stran.) [On neizogibno zavaja tistega, ki si prizadeva zavesti Boga.] Kajti karkoli človek seje, to in samo to je to, kar bo požel. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 8, 'Kajti kdor seje v svoje lastno meso, (spodnjo naravo, čutnost), bo od mesa žel propad in rušenje in uničenje, toda kdor seje v Duha, bo od Duha žel večno življenje. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 9, 'In ne izgubljajmo srca in ne postanimo naveličani in ne popuščajmo v plemenitem delovanju in pravilnem ravnanju, kajti želi bomo pravočasno in ob določenem pravem času, če le ne popustimo in ne izgubimo našega poguma in ne oslabimo. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 10, 'Torej ko se pokaže prilika in se nam odpre priložnost, delajmo [ moralno] dobro vsem ljudem, [ne samo, da smo jim koristni ali v dobiček, temveč da delamo tudi to, kar je za njihovo duhovno dobro in napredek]. Pazite na to, da boste v blagoslov, še posebej tistim iz družine verujočih, [tistih, ki z vami pripadajo Božji družini, vernikom]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 11, 'Glejte s kako velikimi črkami vam pišem s svojo lastno roko. [ Dobro si zapomnite moje zaključne besede.] ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 12, 'Tisti, ki hočejo narediti dober vtis in dobro predstavo v mesu, vas silijo, da prejmeto obrezo, preprosto zato, da oni lahko ubežijo pred preganjanjem zvestobi križa Jezusa Kristusa (Mesija, Maziljenca). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 13, 'Kajti celo obrezani [Judje] sami se [resnično] ne držijo postave, ampak vas hočejo imeti obrezane zato, da bi lahko slavili v vašem mesu, (vaši podreditvi zunanjim obredom). ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 14, 'Toda daleč naj bo od mene to, da bi slavil [v čimerkoli ali komerkoli], razen v križu našega Gospoda Jezusa Kristusa (Mesija), skozi katerega je bil svet križan zame, jaz pa svetu! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 15, 'Kajti [zdaj] niti obreza nič ne velja, niti neobreza, temveč [samo] nova stvaritev, [rezultat novega rojstva in novega značaja v Kristusu Jezusu, Mesiju]. ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 16, 'Mir in usmiljenje naj bosta nad vsemi, ki hodijo po tem pravilu, [ki se vzgajajo in svoja življenja uravnavajo po teh načelih], celo nad [resničnim] Božjim Izraelom!  ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 17, 'Od sedaj naprej naj mi nihče ne dela težav, [da bi mi bilo potrebno braniti mojo avtoriteto apostola in božansko resničnost mojega evangelija], kajti na svojem telesu nosim [vžgane] znake Gospoda Jezusa, [rane, brazgotine in druge zunanje dokaze preganjanj – ti pričajo o Njegovi lastnini nad menoj]! ');
INSERT INTO `SloOjacano_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (48, 6, 18, 'Milost, (duhovna naklonjenost, blagoslov) našega Gospoda Jezusa Kristusa, (Maziljenca, Mesija) naj bo z vašim Duhom, bratje. Amen (tako naj bo).   ');
